let write_sarif_json_schema : _ -> sarif_json_schema -> _ = (
  fun ob (x : sarif_json_schema) ->
    Buffer.add_char ob '{';
    let is_first = ref true in
    if !is_first then
      is_first := false
    else
      Buffer.add_char ob ',';
      Buffer.add_string ob "\"version\":";
    (
      write_sarif_version
    )
      ob x.version;
    (match x.inline_external_properties with None -> () | Some x ->
      if !is_first then
        is_first := false
      else
        Buffer.add_char ob ',';
        Buffer.add_string ob "\"inlineExternalProperties\":";
      (
        write__external_properties_list
      )
        ob x;
    );
    (match x.properties with None -> () | Some x ->
      if !is_first then
        is_first := false
      else
        Buffer.add_char ob ',';
        Buffer.add_string ob "\"properties\":";
      (
        write_property_bag
      )
        ob x;
    );
    if !is_first then
      is_first := false
    else
      Buffer.add_char ob ',';
      Buffer.add_string ob "\"runs\":";
    (
      write__run_list
    )
      ob x.runs;
    (match x.schema with None -> () | Some x ->
      if !is_first then
        is_first := false
      else
        Buffer.add_char ob ',';
        Buffer.add_string ob "\"$schema\":";
      (
        Yojson.Safe.write_string
      )
        ob x;
    );
    Buffer.add_char ob '}';
)
